from dbbase import MusicDBRootDataIOfrom dbparse import MusicDBGroupDataIOfrom dbmeta import MatchProducerIOfrom musicdb.albumoftheyear import MusicDBParamsfrom musicdb.albumoftheyear import MatchOmitdef test_matchomit():    omit = MatchOmit(verbose=True)    assert hasattr(omit, "isValid"), f"MatchOmit [{omit}] does not have isValid function"    assert callable(getattr(omit, "isValid")), f"Can not call omit.isValid() from [{omit}]"def test_matchprod():    params = MusicDBParams()    rdio = MusicDBRootDataIO(db=params.db, verbose=True)    gdio = MusicDBGroupDataIO(rdio, params, verbose=True)    gdio.addGroupData()    omit = MatchOmit(verbose=True)        matchprodio = MatchProducerIO(rdio, omit, verbose=True)    matchprodio.make(test=True)    if __name__ == "__main__":    test_matchomit()    test_matchprod()    